# Custom Dataset 클래스 정의
class CustomImageDataset(torch.utils.data.Dataset):
    def __init__(self, path, dataframe, transform=None, force_png=False):
        self.path = path
        self.dataframe = dataframe
        self.transform = transform
        self.force_png = force_png  # New parameter to force loading as .png

    def __len__(self):
        return len(self.dataframe)

    def __getitem__(self, idx):
        filename = self.dataframe.iloc[idx]['filename'].strip()

        # If force_png is True, ensure that the file extension is .png
        if self.force_png:
            filename = os.path.splitext(filename)[0] + ".png"

        img_path = os.path.join(self.path, filename)

        try:
            image = Image.open(img_path)
        except FileNotFoundError:
            raise FileNotFoundError(f"File not found: {img_path}")

        # Handle RGBA images
        if image.mode == 'RGBA':
            background = Image.new("RGBA", image.size, (255, 255, 255, 255))
            image = Image.alpha_composite(background, image).convert("RGB")
        else:
            image = image.convert("RGB")

        label = self.dataframe.iloc[idx]['label']

        if self.transform:
            image = self.transform(image)

        return image, label

