        val_dataset = CustomImageDataset(validation_image_path, validation_image_df[['filename', 'label']],
                                          transform=transforms.Compose([
                                          transforms.Resize((224, 224)),
                                          transforms.ToTensor(),
                                          transforms.Normalize(mean=[0.4772, 0.4400, 0.4257], std=[0.2619, 0.2526, 0.2522])
                                      ])
                                  )
        train_loader = DataLoader(training_dataset, batch_size=batch_size, shuffle=True, num_workers=8, pin_memory=True)
        val_loader = DataLoader(val_dataset, batch_size=batch_size, shuffle=False, num_workers=8, pin_memory=True)

        model = models.resnet18(pretrained=False)
        num_ftrs = model.fc.in_features
        model.fc = nn.Sequential(
            nn.Dropout(p=dropout_rate),
            nn.Linear(num_ftrs, 31)
        )
        model.to(device)

        if optimizer_name == "adam":
            optimizer = optim.Adam(model.parameters(), lr=lr)
        elif optimizer_name == "adamw":
            optimizer = optim.AdamW(model.parameters(), lr=lr, weight_decay=0.01)
        else:
            raise ValueError("Unknown optimizer")

        criterion = nn.CrossEntropyLoss()

        train_model(model, train_loader, val_loader, criterion, optimizer, num_epochs=50, experiment_name=experiment_name, patience=5)

