def make_file_batches(image_folder, batch_size):
    '''
    image_folder에 들어있는 image의 이름을 batch_size 만큼 묶어서 list 형태로 return
    '''
    # 전체 파일 목록 불러오기
    all_files = sorted(os.listdir(image_folder))  # 정렬된 파일 리스트
    batches = []

    # 파일을 batch_size 단위로 묶기
    for i in range(0, len(all_files), batch_size):
        batch = all_files[i:i + batch_size]  # 슬라이싱으로 배치 생성
        batches.append(batch)

    print("num_batches = ", len(batches))

    return batches

def preprocess_images(image_names, device='cpu'):
    """
    이미지들에 대해 전처리 수행
    """
    im_pils = []  # 원본 PIL 이미지 저장
    im_data_list = []  # 전처리된 이미지 텐서 저장
    orig_sizes = []  # 원본 이미지 크기 저장

    # 이미지 전처리
    transforms = T.Compose([
        T.Resize((640, 640)),
        T.ToTensor(),
    ])

    # 각 이미지에 대해 처리
    for image_name in image_names:
        im_pil = Image.open(image_name).convert('RGB')
        w, h = im_pil.size
        convert_image = transforms(im_pil).to(device)

        im_pils.append(im_pil)
        orig_sizes.append(torch.tensor([w, h]))
        im_data_list.append(convert_image)

    # 결과 저장
    batch_data = torch.stack(im_data_list, dim=0).to(device)  # (N, C, H, W)
    orig_sizes = torch.stack(orig_sizes, dim=0).to(device)  # (N, 2)

    return im_pils, batch_data, orig_sizes

def person_bbox_save(im_pils, labels, boxes, scores, image_names, save_path):
    for i, image_name in enumerate(image_names):
        persont_bbox = None

        for j, label in enumerate(labels[i]):
            if label==0: # label 0이 사람에 해당
                person_bbox = boxes[i][j]
                break

        # 이미지 불러오기
        img = im_pils[i]

        if person_bbox is not None:
            # Bounding Box 좌표 가져오기
            x_min, y_min, x_max, y_max = map(int, person_bbox)

            # Bounding Box 영역을 자른 이미지 생성
            cropped_img = img.crop((x_min, y_min, x_max, y_max))

            # 저장
            cropped_img.save(f"{save_path}/{image_name}")

        else:
            print("No bounding box found with label 0.")
            print(": ", image_name)

